(363, '_transient_dash_01e18dead815ce736e3b9cccfbd773a5', '<div class="rss-widget"><ul><li><a class=''rsswidget'' href=''https://wordpress.org/news/2017/08/the-month-in-wordpress-july-2017/''>The Month in WordPress: July 2017</a> <span class="rss-date">2 de agosto de 2017</span><div class="rssSummary">After a particularly busy month in June, things settled down a bit in the WordPress world — WordPress 4.8’s release went very smoothly, allowing the Core team to build up some of the community infrastructure around development. Read on for more interesting news from around the WordPress world in July. Weekly meeting for new core [&hellip;]</div></li></ul></div><div class="rss-widget"><ul><li><a class=''rsswidget'' href=''https://heropress.com/essays/skills-speak-louder-gender/?utm_source=rss&#038;utm_medium=rss&#038;utm_campaign=skills-speak-louder-gender''>HeroPress: Your Skills Speak Louder Than Your Gender</a></li><li><a class=''rsswidget'' href=''https://wordpress.org/news/2017/08/the-month-in-wordpress-july-2017/''>Dev Blog: The Month in WordPress: July 2017</a></li><li><a class=''rsswidget'' href=''https://wptavern.com/jetpack-5-2-brings-major-improvements-to-the-contact-form-module''>WPTavern: Jetpack 5.2 Brings Major Improvements to the Contact Form Module</a></li></ul></div>', 'no'),
