(22, 1, '2017-08-03 16:19:19', '2017-08-03 19:19:19', '<div class="form-item">\r\n	[text* nome placeholder "Nome"]\r\n</div>\r\n<div class="form-item">\r\n	[text* email placeholder "E-mail"]\r\n</div>\r\n<div class="form-item">\r\n	[text* telefone class:telefone placeholder "Telefone"]\r\n</div>\r\n<div class="form-item">\r\n	[text* assunto placeholder "Assunto"]\r\n</div>\r\n<div class="form-item">\r\n	[textarea mensagem placeholder "Mensagem"]\r\n</div>\r\n<div class="form-item">\r\n	[submit class:button class:upper "Enviar"]\r\n</div>\n1\nFormulário de contato WPBase\nWPBase <webmaster@vespera.com.br>\nwebmaster@vespera.com.br\nNome: [nome]\r\nE-mail: [email]\r\nTelefone: [telefone]\r\nAssunto: [assunto]\r\n\r\nMensagem:\r\n[mensagem]\nReply-To: [email]\n\n1\n\n\nWPBase "[your-subject]"\nWPBase <webmaster@vespera.com.br>\n[your-email]\nCorpo da mensagem:\r\n[your-message]\r\n\r\n-- \r\nEste e-mail foi enviado de um formulário de contato em WPBase (http://localhost/wp-base)\nReply-To: webmaster@vespera.com.br\n\n\n\nAgradecemos a sua mensagem.\nOcorreu um erro ao tentar enviar sua mensagem. Tente novamente mais tarde.\nUm ou mais campos possuem um erro. Verifique e tente novamente.\nOcorreu um erro ao tentar enviar sua mensagem. Tente novamente mais tarde.\nVocê deve aceitar os termos e condições antes de enviar sua mensagem.\nO campo é obrigatório.\nO campo é muito longo.\nO campo é muito curto.\nO formato de data está incorreto.\nA data é anterior à mais antiga permitida.\nA data é posterior à maior data permitida.\nOcorreu um erro desconhecido ao enviar o arquivo.\nVocê não tem permissão para enviar esse tipo de arquivo.\nO arquivo é muito grande.\nOcorreu um erro ao enviar o arquivo.\nO formato de número é inválido.\nO número é menor do que o mínimo permitido.\nO número é maior do que o máximo permitido.\nA resposta para o quiz está incorreta.\nO código digitado está incorreto.\nO endereço de e-mail informado é inválido.\nA URL é inválida.\nO número de telefone é inválido.', 'Contato', '', 'publish', 'closed', 'closed', '', 'contato', '', '', '2017-08-03 16:20:31', '2017-08-03 19:20:31', '', 0, 'http://localhost/wp-base/?post_type=wpcf7_contact_form&#038;p=22', 0, 'wpcf7_contact_form', '', 0),
